import React from 'react'
import {Card,Table,Button,Icon} from "antd"
import "./category.less"

export default class Category extends React.Component {
    render(){
        const title = "一级分类列表"
        return (
            <Card title={title} extra={<a href="#">More</a>} style={{ width: 300 }}>
                <p>Card content</p>
                <p>Card content</p>
                <p>Card content</p>
            </Card>
        )
    }
}
